import React, { Component } from "react";
import { ListGroup, ListGroupItem, Badge } from "reactstrap";

class BestPlayers extends Component {
  render() {
    return (
      <ListGroup>
        <h1>
          <Badge style={{ height: 30, width: 30 }} color="primary">
            1
          </Badge>
        </h1>
        <ListGroupItem
          style={{ marginLeft: 120, marginRight: 120 }}
          color="success"
        >
          Cras justo odio
        </ListGroupItem>
        <ListGroupItem color="info">Dapibus ac facilisis in</ListGroupItem>
        <ListGroupItem color="warning">Morbi leo risus</ListGroupItem>
        <ListGroupItem color="danger">Porta ac consectetur ac</ListGroupItem>
      </ListGroup>
    );
  }
}
export default BestPlayers;
